import React from "react";
import "../css/Top.css";

interface TopProps {
    setTopPage : Function;
    setOther: Function;
}

const Top: React.FC<TopProps> = ({setTopPage, setOther}) => {
    const next = () => {
        setTopPage(false);
        setOther(true);
    }

    return (
        <div className='top-wrapper'>
            <div className='center'>
                <h1 className='Kijima'>Kijima Riku</h1>
                <p className='portforio'>-PORTFORIO-</p>
                <button className="next bg-blue-500 hover:bg-blue-700 text-white font-bold py-1 px-3 rounded-full" onClick={next}>Click</button>
            </div>
        </div>
    )
};

export default Top;
